import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import phoneIcon from '../../Image/phoneIcon.svg';
import feedbackIcon from '../../Image/feedbackIcon.svg';
import emailIcon from '../../Image/emailIcon.svg';
import logo from '../../Image/logo.png';
import basket from '../../Image/basket.svg';
import "./Header.css";

const TopHeader = () => {
  return (
    <Navbar className="upper-header" variant="dark" fixed="top">
      <Container>
        <Nav className="me-auto">
          <Nav.Link href="tel:+77777777777" className="upper-nav-link">
            <img src={phoneIcon} alt="Phone" className="icon" /> +7(777)777-77-77
          </Nav.Link>
          <Nav.Link href="/feedback" className="upper-nav-link">
            <img src={feedbackIcon} alt="Feedback" className="icon" /> Обратная связь
          </Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href="mailto:sampletext@gmail.com" className="upper-nav-link">
            <img src={emailIcon} alt="Email" className="icon" /> sampletext@gmail.com
          </Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
};

const MainHeader = () => {
  return (
    <Navbar className="main-header" expand="lg">
      <Container>
        <Navbar.Brand href="/" className="brand-logo">
          <img src={logo} alt="logo" className="icon-placeholder-logo" />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/catalog" className="main-nav-link">Каталог</Nav.Link>
            <Nav.Link href="/about" className="main-nav-link">О нас</Nav.Link>
            <Nav.Link href="/account" className="main-nav-link">Личный кабинет</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link href="/cart" className="main-nav-link">
              Корзина <img src={basket} alt="Basket" className="icon-placeholder" />
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

const Header = () => {
  return (
    <>
      <TopHeader />
      <MainHeader />
    </>
  );
};

export default Header;
